import './App.css';

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
} from "react-router-dom";
export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <News country={"in"} pagesize={9} category={"general"} />
          <Routes>
            <Route exact path="/general"><News country={"in"} pagesize={9} category={"general"} /></Route>
            <Route exact path="/health"><News country={"in"} pagesize={9} category={"health"} /></Route>
            <Route exact path="/science"><News country={"in"} pagesize={9} category={"science"} /></Route>
            <Route exact path="/entertainment"><News country={"in"} pagesize={9} category={"entertainment"} /></Route>
            <Route exact path="/business"><News country={"in"} pagesize={9} category={"business"} /></Route>
            <Route exact path="/sports"><News country={"in"} pagesize={9} category={"sports"} /></Route>
            </Routes>
        </Router>
      </div>
    )
  }
}
